import React from 'react'

const obj = [
    {
        name:"Savings",
        color:'#f9c74f',
     
    },
    {
        name:"Investments",
        color:'#f9c74f',
      
    },
    {
       name:"Expense",
        color:'rgb(54, 162, 235)',
      
    }
]  

export default function List(){
    return(
        <div className="flex flex-col py-6 gap-3">
            <h1 className ='py-4 font-bold text-xl'></h1>
            {obj.map((v,i)=><Transaction key={i} category={v}></Transaction>)}
        </div>
    )
}
function Transaction({caegory}){
    if(!category)return null;
    return(
        <div className="item flex justify-center bg-gray-50 py-2 rounded-r">
             <span className='block w-full'>Savings </span>
        </div>
    )
}
